import { faPlus } from '@fortawesome/free-solid-svg-icons';

export default function AddCoffeeBtn(props){
    return (
        <div>

                               <button >
                        <FontAwesomeIcon icon={ faPlus } className='icons' />
            </button>

        </div>
    )
}
